void model_init(){
    conv2d_3_data = init_conv2d_3_data();
    batch_normalization_8_data = init_batch_normalization_8_data();
    conv2d_4_data = init_conv2d_4_data();
    batch_normalization_9_data = init_batch_normalization_9_data();
    conv2d_5_data = init_conv2d_5_data();
    batch_normalization_10_data = init_batch_normalization_10_data();
    dense_3_data = init_dense_3_data();
    batch_normalization_11_data = init_batch_normalization_11_data();
    dense_4_data = init_dense_4_data();

}

void model_predict(data3d_t input, data1d_t * output){
  
    prepare_buffers();
    
    //*************** LAYER 0 **************//
    // Layer name: conv2d_3
    data3d_t output0;
    conv2d_layer(conv2d_3_data, input, &output0);
    // Activation layer for conv2d_3
    relu_activation(output0.data, 10816);
    
    //*************** LAYER 1 **************//
    // Layer name: max_pooling2d_4
    input = output0;
    static const pooling2d_layer_t max_pooling2d_4_data = { 2, 2 };
    max_pooling2d_layer(max_pooling2d_4_data, input, &output0);
    
    //*************** LAYER 2 **************//
    // Layer name: batch_normalization_8
    batch_normalization3d_layer(batch_normalization_8_data, &output0);
    
    //*************** LAYER 3 **************//
    // Layer name: conv2d_4
    input = output0;
    conv2d_layer(conv2d_4_data, input, &output0);
    // Activation layer for conv2d_4
    relu_activation(output0.data, 7744);
    
    //*************** LAYER 4 **************//
    // Layer name: max_pooling2d_5
    input = output0;
    static const pooling2d_layer_t max_pooling2d_5_data = { 2, 2 };
    max_pooling2d_layer(max_pooling2d_5_data, input, &output0);
    
    //*************** LAYER 5 **************//
    // Layer name: batch_normalization_9
    batch_normalization3d_layer(batch_normalization_9_data, &output0);
    
    //*************** LAYER 6 **************//
    // Layer name: conv2d_5
    input = output0;
    conv2d_layer(conv2d_5_data, input, &output0);
    // Activation layer for conv2d_5
    relu_activation(output0.data, 576);
    
    //*************** LAYER 7 **************//
    // Layer name: batch_normalization_10
    batch_normalization3d_layer(batch_normalization_10_data, &output0);
    
    //*************** LAYER 8 **************//
    // Layer name: flatten_2
    input = output0;
    data1d_t output1;
    flatten3d_layer(input, &output1);
    
    //*************** LAYER 9 **************//
    // Layer name: dropout_2
    data1d_t input1;
    input1 = output1;
    
    
    //*************** LAYER 10 **************//
    // Layer name: dense_3
    input1 = output1;
    dense_layer(dense_3_data, input1, &output1);
    
    // Activation layer for dense_3
    relu_activation(output1.data, 64);
    
    //*************** LAYER 11 **************//
    // Layer name: batch_normalization_11
    batch_normalization1d_layer(batch_normalization_11_data, &output1);
    
    //*************** LAYER 12 **************//
    // Layer name: dense_4
    input1 = output1;
    dense_layer(dense_4_data, input1, &output1);
    
    // Activation layer for dense_4
    softmax_activation(output1.data, 10);
    

    *output = output1;

}

int model_predict_class(data3d_t input, data1d_t * results){
  
   
    model_predict(input, results);
    
    return argmax(*results);
    //return argmax(data1d_t);

}

